import { makeStyles, StylesProvider } from '@material-ui/core/styles';


export default makeStyles({

    card: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',
        width: 400,
        direction: 'right'
    },

    conatiner: {
        display: 'flex',
        alignItems: 'center',
        flexDirection: 'column',


    },
    form: {
        display: 'flex',
        flexDirection: 'column',
        width: 300,
        alignItems: 'center'
    },
    avatar: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'

    },
    button: {
        display: 'flex',
        flexDirection: 'column',
        alignItems: 'center'
    }


})
